import React from "react";
import { Link } from "react-router-dom";

const Users = () => {
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",
    height: "93vh",
    padding: "50px",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  let users = [
    { id: 1, name: "Abir", email: "abir@gmail.com" },
    { id: 2, name: "Dhruv", email: "dhruv@gmail.com" },
    { id: 3, name: "Adya", email: "adya@gmail.com" },
    { id: 4, name: "Ryka", email: "ryka@gmail.com" },
    { id: 5, name: "Pratyush", email: "pratyush@gmail.com" },
  ];
  return (
    <div style={mystyle}>
      <h1>Users List</h1>
      <ul>
        {users.map((item) => {
          <li>
            <Link to="/users/${item.name}">{item.name}</Link>
          </li>;
        })}
        <li>
          <Link to="/users/madhuri">Madhuri</Link>
        </li>
        <li>
          <Link to="/users/ashwini">Ashwini</Link>
        </li>
      </ul>
    </div>
  );
};

export default Users;
